request.description:
## Search Title

This API endpoint makes an HTTP GET request to search for a specific title in the ntuaflix database based on a part provided in the request body.

### Request

The request should be sent to `localhost:9876/ntuaflix_api/info/searchtitle` with the following payload in the raw request body type:

``` json
{
  "titlePart": ""
}

 ```

### Query Parameters

- format(string, optional): The response format. It can have one of the values "json" or "csv".


### Response

Upon a successful execution, the API returns a status code of 200 and a JSON object with the following structure:

``` json
[
  {
    "titleID": "",
    "type": "",
    "originalTitle": "",
    "titlePoster": "",
    "startYear": "",
    "endYear": "",
    "genres": [
      {
        "genreTitle": ""
      }
    ],
    "titleAkas": [
      {
        "akaTitle": "",
        "regionAbbrev": ""
      }
    ],
    "principals": [
      {
        "nameID": "",
        "name": "",
        "category": ""
      }
    ],
    "rating": {
      "avRating": "",
      "nVotes": ""
    }
  }
]

 ```

The response provides detailed information about the title, including its ID, type, original title, poster, start and end year, genres, alternate titles, principals, and rating. It is also possible to receive the response in csv format by using the format query parameter.

